description:
In the centre of part 3 of Rohmer's &quot;4 Seasons-Cycle&quot; stands a young man, Gaspard, who went to Dinard (a town by the sea in the Bretagne) because he hopes to meet the girl he thinks he is in love with - Lena. Shortly after his arrival he comes into contact with Margot who works as a servant at her aunt's creperie. He spends a long time with her, and discusses the way he feels about Lena but he hesitates to tell the truth about his relationship. The reason is that he isn't quite sure himself. Although he insists he loves Lena, doubts arise... 

